import './ExpenseDate.css';


const ExpenseDate = (dateProp) =>{
    const year =dateProp.date.getFullYear();
    const mont=dateProp.date.toLocaleString('en-US',{month:'long'})
    const da =dateProp.date.toLocaleString('en-US',{day:'2-digit'})


    return(
         /* <div>{ dateProps.date.toISOString()  }</div> */
         <div className='date'>
         <div>{ da }</div>
         <div>{ mont }</div>
         <div>{ year }</div>

     </div>
    );
}

export default ExpenseDate;
